import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the price filter section to be visible
    await page.waitForSelector('.price-filter', { timeout: 5000 });

    // Wait for min and max price inputs
    await page.waitForSelector('#minPrice', { timeout: 5000 });
    await page.waitForSelector('#maxPrice', { timeout: 5000 });

    // Set min price
    const minPriceInput = await page.$('#minPrice');
    await minPriceInput.click({ clickCount: 3 });
    await minPriceInput.type('100');

    // Set max price
    const maxPriceInput = await page.$('#maxPrice');
    await maxPriceInput.click({ clickCount: 3 });
    await maxPriceInput.type('500');

    // Take screenshot after entering price range
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_price_range_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_price_range_filled.png'));

    // Click the "Apply" button (by class and text)
    const applyButton = await page.$('.apply-filter');
    await applyButton.click();

    // Wait for products grid/list to update (wait for any product card to appear)
    await page.waitForSelector('.product-card, .product-card-list', { timeout: 5000 });

    // Take screenshot after applying filter
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_apply_filter.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_apply_filter.png'));

    // Extract all visible product prices to verify filter worked
    const productPrices = await page.$$eval(
      '.product-card .product-price, .product-card-list .product-price',
      nodes => nodes.map(n => {
        // Try to extract price as float
        const match = n.textContent.match(/\$([\d,]+\.\d{2})/);
        return match ? parseFloat(match[1].replace(/,/g, '')) : null;
      }).filter(x => x !== null)
    );

    // Check if all prices are within the range [100,500]
    const allWithinRange = productPrices.length > 0 && productPrices.every(p => p >= 100 && p <= 500);

    return {
      success: true,
      action: "Applied price range filter (100 to 500) and verified product prices are within range",
      extractedData: {
        prices: productPrices,
        allPricesWithinRange: allWithinRange
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
